import React from "react";
import { Link } from "react-router-dom";
import axios from 'axios';
import { render } from "@testing-library/react";
import { SideNav, Toggle, Nav, NavItem, NavIcon, NavText } from '../components';
// import Navbar from "../components/Navbar1";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import './guideline.css';
import logo from '../icons/Home.png';

class Guideline extends React.Component {
  constructor(props) {
    super(props);
    this.state = { guideline: "" };
  }

  callAPI() {
    fetch("http://localhost:3000/guideline")
      .then(res => res.text())
      .then(res => this.setState({ guideline: res }));
  }

  componentWillMount() {
    this.callAPI();
  }

  render() {

    return (
      <>
        <div>
          <img className="logo" src={logo} alt="Logo" />
        </div>
        <Router>
          <SideNav>
            <Toggle />
            <Nav>
              <NavItem>
                <NavIcon />
                <NavText />
              </NavItem>
              <NavItem>
                <NavIcon />
                <NavText />
              </NavItem>
            </Nav>
          </SideNav>
          <Switch>
            <Route path='/guideline' />
          </Switch>

        </Router>

        <div className="container">
          <Link to="/">
            <button type="button" class="btn btn-outline-primary">Home</button>
          </Link>
          <Link to="/guideline">
            <button type="button" class="btn btn-primary">Guideline</button>
          </Link>
          <Link to="/priceComparison">
            <button type="button" class="btn btn-outline-primary">Price Comparison</button>
          </Link>
          <div>
            <p>{this.state.guideline}</p>
          </div>
        </div>
      </>

    );
  }
}

export default Guideline;
